window.bookSummaryJSON = "<p>Is our destiny written inside our very DNA? Richard Rudd suggests that humanity is on the verge of a major shift in consciousness rooted in a new understanding of how our genes operate. He introduces this fantastic possibility, showing how the \"gene keys\" are an inner language designed to transform our core beliefs about ourselves and raise us to a higher level of awareness. </p> <p>The book works alongside state-of-the-art online profiling software that provides instantaneous free \"Hologenetic Profiles\", based on astrological data and revealing the underlying genetic patterns governing relationships, finances, and health.</p>"; 
